    [],nt"revision_timestamp": "2016-05-25T00:52:20.245953",nt"name": "airport-surveillance-radar-model-8",nt"isopen":
    true,nt"url": null,nt"notes": "The Airport Surveillance Radar Model 8 (ASR-8)
    is a short-range (60 nautical mile (nmi)), analog radar system used to detect and
    report the presence and location of aircraft in terminal and en route airspace.
     The ASR-8 uses a moving target indicator (MTI) processing and output target data
    in analog form.  A few ASR-8 systems are integrated with a collocated digitizing
    processor to provide a digital output. The ASR-8 is used in conjunction with the
    Air Traffic Control Beacon Interrogator Models 5 (ATCBI-5) or Mode Select (Mode
    S).  Only sites with the collocated digitizer provide correlated radar/beacon data
    in a digital output.",nt"license_title": "Other License Specified",nt"extras":
